function change_rating() {
	$('.rating-stars').each(function(index, el) {
	var i=0,
		$rating = $(el).data('rating'),
		$items = $(el);

		// console.log($items);
	for (i = 0; i < $rating; i++) {
	  $items.find('li')[i].classList.add('rate');
	}
});
}

