$( ".rating-stars.is-add" )
  .mouseenter(function() {
    var $this = $(this),
    	$items = $this.children(),
    	$rating = $this.attr('data-rating');;

    	$items.mouseover(function() {
    		var $index = $(this).index();
    		// $this.attr('data-rating', $index);
    		for (i = 0; i <= $index; i++) {
			  $items[i].classList.add('rate');
			}
    	});
		$items.mouseout(function() {
			// console.log($rating);
			for (i = $rating; i < $items.length; i++) {
			  $items[i].classList.remove('rate');
			}
		});
		$items.click(function(e){
			e.preventDefault();
			var $index = $(this).index();
    		for (i = 0; i <= $index; i++) {
			  $items[i].classList.add('rate');
			}
			$rating=$index+1;
    		$this.attr('data-rating', $rating);
		});
  })
  .mouseleave(function() {
    change_rating();
  });

